// accessGroupModelsPreview returns a short preview of model names.
func accessGroupModelsPreview(models []string) string {
	if len(models) == 0 {
		return ""
	}
	if len(models) <= 3 {
		return strings.Join(models, ", ")
	}
	return strings.Join(models[:3], ", ") + fmt.Sprintf(" +%d more", len(models)-3)
}

